import { useIsFocused } from "@react-navigation/native";
import React, {
  useCallback,
  useEffect,
  useMemo,
  useRef,
  useState,
} from "react";
import {
  View,
  Animated,
  ScrollView,
  Text,
  TextInput,
  Pressable,
} from "react-native";
import { SvgXml } from "react-native-svg";
import { useDispatch, useSelector } from "react-redux";
import customStyle from "../../assets/stylesheet";
import ChatCart from "../../Cart/ChatCart";
import { getConversation, getConversationVendor } from "../../Class/message";
import ActivityLoader from "../../components/ActivityLoader";
import SearchBar from "../../components/SearchBar";
import BottomSheet, { BottomSheetScrollView } from "@gorhom/bottom-sheet";
import { setChatSearchRef } from "../../Reducers/chatSearchRef";
import SellerList from "./SellerList";
import ContactList from "./ContactList";
import { setChatBottomRef } from "../../Reducers/chatBottomRef";
import ChatHeader from "./ChatHeader";

export default function ChatList(props) {
  const scrollY = new Animated.Value(0);
  const diffClamp = Animated.diffClamp(scrollY, 0, 300);
  const translateY = diffClamp.interpolate({
    inputRange: [0, 300],
    outputRange: [0, -300],
  });
  const [Conversations, setConversations] = React.useState();
  const [AllConversation, setAllConversations] = React.useState();
  const user = useSelector((state) => state.user);
  const [Loader, setLoader] = React.useState(true);
  const isFocused = useIsFocused();
  const chatSearchRef = useSelector((state) => state.chatSearchRef);
  const searchX = props?.route?.params?.search;
  const sheetRef = useRef(null);
  const [index, setIndex] = useState(-1);
  const [type, setType] = useState("");
  const dispatch = useDispatch();
  const [data, setData] = useState();
  const chatBottomRef = useSelector((state) => state.chatBottomRef);
  const snapPoints = useMemo(() => ["90%"], []);
  const handleSheetChange = useCallback((index) => {
    setIndex(index);
  }, []);
  const handleSnapPress = useCallback((index) => {
    sheetRef.current?.snapToIndex(index);
  }, []);
  const handleClosePress = useCallback(() => {
    sheetRef.current?.close();
    dispatch(setChatBottomRef(null));
  }, []);
  const vendor=useSelector(state=>state.vendor)

  //console.log(chatBottomRef)
  React.useEffect(() => {
    if (user&&!vendor) {
      getConversation(user.token)
        .then((res) => {
          setLoader(false);
          setConversations(res.data.conversations);
          setAllConversations(res.data.conversations);
          //console.warn(res.data.conversations)
        })
        .catch((err) => {
          setLoader(false);
          console.warn(err.response.data.msg);
        });
    }else if(vendor){
      getConversationVendor(user.token,vendor?.service?.id)
        .then((res) => {
          setLoader(false);
          setConversations(res.data.conversations);
          setAllConversations(res.data.conversations);
          //console.warn(res.data.conversations)
        })
        .catch((err) => {
          setLoader(false);
          console.warn(err.response.data.msg);
        });
    }
  }, [user, isFocused]);

  const search = (val, data) => {
    if (!Array.isArray(data)) {
      return [];
    }
    if (!val) {
      return data;
    }
    return data.filter((d) =>
      d.users
        .filter((s) => s.userId != user.user.id)[0]
        .user.username.toUpperCase()
        .match(val.toUpperCase())
    );
  };
  useEffect(() => {
    if (!searchX) {
      return;
    }
    setConversations(search(chatSearchRef, AllConversation));
  }, [chatSearchRef]);

  if (Loader) {
    return (
      <View
        style={{
          flex: 1,
          justifyContent: "center",
          alignItems: "center",
        }}>
        <ActivityLoader />
      </View>
    );
  }
  return (
    <View style={{ flex: 1 }}>
      <ChatHeader
        onContact={() => {
          setType("Contact");
          setIndex(0);
        }}
        onSearch={() => {
          setType("Search");
          setIndex(0);
        }}
        {...props}
      />
      <ScrollView
        style={{ flex: 1 }}
        scrollEventThrottle={16}
        showsVerticalScrollIndicator={false}
        stickyHeaderHiddenOnScroll={true}
        stickyHeaderIndices={[0]}
        onScroll={(e) => {
          scrollY.setValue(e.nativeEvent.contentOffset.y);
        }}>
        <View
          style={{
            minHeight: "100%",
          }}>
          <View style={{ height: 0 }} />
          {Conversations &&
            Conversations.map((doc, i) => (
              <ChatCart readOnly={doc.readOnly} data={doc} key={i} {...props} />
            ))}
          {Conversations && Conversations.length == 0 && (
            <View style={customStyle.fullBox}>
              <SvgXml xml={noResult} />
              <Text
                style={{
                  marginVertical: 20,
                  textAlign: "center",
                  fontSize: 24,
                }}>
                {searchX ? "Ops, No Result" : "No Member Added"}
              </Text>
            </View>
          )}
        </View>
        <View style={{ height: 0 }} />
      </ScrollView>
      {isFocused && (
        <BottomSheet
          backgroundStyle={{
            backgroundColor: index == -1 && isFocused ? "#ffffff" : "#4ADE80",
          }}
          handleIndicatorStyle={{
            backgroundColor: "#ffffff",
          }}
          ref={sheetRef}
          index={index}
          enablePanDownToClose={true}
          snapPoints={snapPoints}
          onChange={handleSheetChange}>
          {index != -1 && isFocused && (
            <Header
              type={type}
              value={chatSearchRef}
              onChange={(e) => dispatch(setChatSearchRef(e))}
              onConfirm={() => {
                handleClosePress();
              }}
            />
          )}
          <BottomSheetScrollView style={{ backgroundColor: "white" }}>
            {type == "Search" ? (
              <SellerList
                bottomRef={sheetRef}
                data={data}
                onClose={setData}
                navigation={props.navigation}
                seller={true}
                setIndex={setIndex}
              />
            ) : (
              <ContactList
                bottomRef={sheetRef}
                data={data}
                onClose={setData}
                seller={false}
                navigation={props.navigation}
                setIndex={setIndex}
              />
            )}
          </BottomSheetScrollView>
          {/* {type != "Search" && (
            <Pressable
              onPress={() => {
                handleClosePress();
                props.navigation.navigate("AddOnlineUser", { data: [] });
              }}
              style={{
                width: 44,
                height: 44,
                justifyContent: "center",
                alignItems: "center",
                backgroundColor: "#4ADE80",
                borderRadius: 22,
                position: "absolute",
                right: 20,
                bottom: 37,
              }}>
              <SvgXml xml={contact} />
            </Pressable>
          )} */}
        </BottomSheet>
      )}
    </View>
  );
}
