const Header = ({ type, onConfirm, onChange, value }) => {
  return (
    <View
      style={{
        backgroundColor: "#4ADE80",
        paddingHorizontal: 20,
        paddingVertical: 24,
      }}>
      <View
        style={{
          flexDirection: "row",
          justifyContent: "space-between",
        }}>
        <Text
          style={{
            fontSize: 20,
            fontWeight: "700",
            color: "#fff",
          }}>
          {type == "Search" ? "Seller List" : "Member List"}
        </Text>
        <Text
          onPress={onConfirm}
          style={{
            fontSize: 16,
            fontWeight: "400",
            color: "#fff",
          }}>
          Done
        </Text>
      </View>
      <View
        style={{
          flexDirection: "row",
          borderRadius: 8,
          backgroundColor: "#fff",
          height: 32,
          marginTop: 12,
          alignItems: "center",
          paddingHorizontal: 8,
          justifyContent: "space-between",
        }}>
        <TextInput
          onChangeText={onChange}
          value={value}
          style={{ flex: 1 }}
          placeholder="Type Name"
        />
        <SvgXml xml={search} />
      </View>
    </View>
  );
};
